import React from 'react';
import Navbar from '../../SharedComponents/Navbar'

type Props = {
    children: any,
    isLogged: boolean
}

function Main({children, isLogged}: Props) {
  return (
    <main>
      <Navbar isLogged={isLogged} />
      {children}
    </main>
  );
}

export default Main;
